import React, { useState, useEffect, createContext } from 'react';
import { BrowserRouter as Router, Switch, Route, Link, Redirect } from 'react-router-dom';
import LoginPage from './pages/LoginPage';
import SignupPage from './pages/SignupPage';
import JobListPage from './pages/JobListPage';
import JobDetailsPage from './pages/JobDetailsPage';
import CandidateProfilePage from './pages/CandidateProfilePage';
import PostJobPage from './pages/PostJobPage';
import ApplicationListPage from './pages/ApplicationListPage';

export const AuthContext = createContext();

function PrivateRoute({ children, roles, ...rest }) {
  const { user } = React.useContext(AuthContext);
  return (
    <Route
      {...rest}
      render={({ location }) =>
        user && (!roles || roles.includes(user.role)) ? (
          children
        ) : (
          <Redirect to={{ pathname: '/login', state: { from: location } }} />
        )
      }
    />
  );
}

function App() {
  const [user, setUser] = useState(() => {
    const json = localStorage.getItem('user');
    return json ? JSON.parse(json) : null;
  });

  useEffect(() => {
    if (user) localStorage.setItem('user', JSON.stringify(user));
    else localStorage.removeItem('user');
  }, [user]);

  const login = (userData, token) => {
    setUser(userData);
    localStorage.setItem('token', token);
  };

  const logout = () => {
    setUser(null);
    localStorage.removeItem('token');
  };

  return (
    <AuthContext.Provider value={{ user, login, logout }}>
      <Router>
        <nav style={{ padding: 10, borderBottom: '1px solid #ccc' }}>
          <Link to="/">Jobs</Link> |{' '}
          {user ? (
            <>
              {user.role === 'employer' && <Link to="/post-job">Post Job</Link>} |{' '}
              {user.role === 'candidate' && <Link to="/profile">My Profile</Link>} |{' '}
              <Link to="/applications">Applications</Link> |{' '}
              <button onClick={logout}>Logout ({user.email})</button>
            </>
          ) : (
            <>
              <Link to="/login">Login</Link> | <Link to="/signup">Signup</Link>
            </>
          )}
        </nav>

        <Switch>
          <Route exact path="/">
            <JobListPage />
          </Route>
          <Route path="/job/:id">
            <JobDetailsPage />
          </Route>
          <Route path="/login">
            <LoginPage />
          </Route>
          <Route path="/signup">
            <SignupPage />
          </Route>
          <PrivateRoute path="/profile" roles={['candidate']}>
            <CandidateProfilePage />
          </PrivateRoute>
          <PrivateRoute path="/post-job" roles={['employer']}>
            <PostJobPage />
          </PrivateRoute>
          <PrivateRoute path="/applications">
            <ApplicationListPage />
          </PrivateRoute>
        </Switch>
      </Router>
    </AuthContext.Provider>
  );
}

export default App;
